function InfoTooltip({isOpen, onClose}) {
    return (
      <section className={`popup popup__success 
      ${isOpen ? `popup_opened` : ""}`}
   >
        <div className={`popup__container`}>
            <div className="popup__success_img"></div>
            <p className="">Вы успешно зарегистрировались</p>
          <button className="popup__close" type="button" onClick={onClose}/>
        </div>
      </section>
    );
  }

  export default InfoTooltip;
